rmission='moderated'/><yt:accessControl action='commentVote' permission='allowed'/><yt:accessControl action='videoRespond' permission='moderated'/><yt:accessControl action='rate' permission='allowed'/><yt:accessControl action='embed' permission='allowed'/><yt:accessControl action='list' permission='allowed'/><yt:accessControl action='autoPlay' permission='allowed'/><yt:accessControl action='syndicate' permission='allowed'/><gd:comments><gd:feedLink rel='http://gdata.youtube.com/schemas/2007#comments' href='http://gdata.youtube.com/feeds/api/videos/l8i9m0JZvJY/comments?v=2' countHint='106'/></gd:comments><yt:location>hereford</yt:location><media:group><media:category label='Sports' scheme='http://gdata.youtube.com/schemas/2007/categories.cat'>Sports</media:category><media:content url='http://www.youtube.com/v/l8i9m0JZvJY?version=3&amp;f=videos&amp;d=Af_sMkfuv5bHKDHIEIvKuwwO88HsQjpE1a8d1GxQnGDm&amp;app=youtube_gdata' type='application/x-shockwave-flash' medium='video' isDefault='true' expression='full' duration='483' yt:format='5'/><media:content url='rtsp://v7.cache1.c.youtube.com/CkULENy73wIaPAmWvFlCm73IlxMYDSANFEgGUgZ2aWRlb3NyIQH_7DJH7r-WxygxyBCLyrsMDvPB7EI6RNWvHdRsUJxg5gw=/0/0/0/video.3gp' type='video/3gpp' medium='video' expression='full' duration='483' yt:format='1'/><media:content url='rtsp://v8.cache2.c.youtube.com/CkULENy73wIaPAmWvFlCm73IlxMYESARFEgGUgZ2aWRlb3NyIQH_7DJH7r-WxygxyBCLyrsMDvPB7EI6RNWvHdRsUJxg5gw=/0/0/0/video.3gp' type='video/3gpp' medium='video' expression='full' duration='483' yt:format='6'/><media:credit role='uploader' scheme='urn:youtube' yt:display='getintofootball' yt:type='partner'>getintofootball</media:credit><media:description type='plain'>Spain 0 - 2 Brazil The final matched up Brazil against Spain, in what was predicted to be quite a tight affair. Spain, who were yet to concede a goal in the tournament and had won every game on their way to the final, were going to have to be at their best defensively to stop a Brazil side that boasted two of the tournaments biggest talents, Ricardo Alves and the player of the tournament Jeferson Goncalves. Spain Alvaro Gonzalez (GK), Jose Luis Giera, Carmelo Garrido, Adolfo Acosta, Antonio Martin, Alfredo Cuadrado, Pedro Villa, Vicente Aguilar, Marcelo Rosado, Raul Diaz (GK) Alfredo Cuadrado, Vicente Aguilar Brazil Fabio Vasconcelos (GK), Scharles Santos, Damiao Souza, Marcos Felipe, Jeferson Goncalves, Sandro Soares, Joao Silva, Ricardo Alves, Severino Silva, Antonio Carvalho (GK) Jeferson Goncalves, Ricardo Alves Match Officials: Mariano Trvaglino, Germinal Lubrano, Paul Leversuch, Craig Grundy Attendance: 703 Third Place Playoff China 1 - 0 England The first game of the last day saw the clash for third place in the tournament between England and China. The game got off to a good start for England with Jonathan Gribbin and David Clarke both having chances to give them an early lead, but the Lei Niu saved well on both occasions. The England defence was well marshalled by Will Norman and they limited China to only speculative long range efforts which didn't trouble Skyres in goal.</media:description><media:keywords>the, fa, blind, world, cup, england, goal, spain, hereford, IBSA, Football, Championship, 2010, brazil, china</media:keywords><media:license type='text/html' href='http://www.youtube.com/t/terms'>youtube</media:license><media:player url='http://www.youtube.com/watch?v=l8i9m0JZvJY&amp;feature=youtube_gdata_player'/><media:thumbnail url='http://i.ytimg.com/vi/l8i9m0JZvJY/default.jpg' height='90' width='120' time='00:04:01.500' yt:name='default'/><media:thumbnail url='http://i.ytimg.com/vi/l8i9m0JZvJY/mqdefault.jpg' height='180' width='320' yt:name='mqdefault'/><media:thumbnail url='http://i.ytimg.com/vi/l8i9m0JZvJY/hqdefault.jpg' height='360' width='480' yt:name='hqdefault'/><media:thumbnail url='http://i.ytimg.com/vi/l8i9m0JZvJY/1.jpg' height='90' width='120' time='00:02:00.750' yt:name='start'/><media:thumbnail url='http://i.ytimg.com/vi/l8i9m0JZvJY/